/*!40000 ALTER TABLE `wp_posts` DISABLE KEYS */;
INSERT INTO `wp_posts` VALUES (1,1,'2015-02-23 21:26:14','2015-02-23 21:26:14','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2015-02-23 21:26:14','2015-02-23 21:26:14','',0,'http://localhost:8080/?p=1',0,'post','',1),(2,1,'2015-02-23 21:26:14','2015-02-23 21:26:14','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost:8080/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','open','open','','sample-page','','','2015-02-23 21:30:52','2015-02-23 21:30:52','',0,'http://localhost:8080/?page_id=2',0,'page','',0),(3,1,'2015-02-23 21:26:23','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2015-02-23 21:26:23','0000-00-00 00:00:00','',0,'http://localhost:8080/?p=3',0,'post','',0),(4,1,'2015-02-23 21:30:52','2015-02-23 21:30:52','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost:8080/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','inherit','open','open','','2-revision-v1','','','2015-02-23 21:30:52','2015-02-23 21:30:52','',2,'http://localhost:8080/?p=4',0,'revision','',0),(5,1,'2015-02-23 21:32:05','2015-02-23 21:32:05','','FARMitRX','','publish','open','open','','farmitrx','','','2015-02-23 21:32:05','2015-02-23 21:32:05','',0,'http://localhost:8080/?page_id=5',0,'page','',0),(6,1,'2015-02-23 21:31:20','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2015-02-23 21:31:20','0000-00-00 00:00:00','',0,'http://localhost:8080/?page_id=6',0,'page','',0),(7,1,'2015-02-23 21:32:05','2015-02-23 21:32:05','','FARMitRX','','inherit','open','open','','5-revision-v1','','','2015-02-23 21:32:05','2015-02-23 21:32:05','',5,'http://localhost:8080/?p=7',0,'revision','',0),(8,1,'2015-02-23 21:32:27','2015-02-23 21:32:27','','Process','','publish','open','open','','process','','','2015-02-23 21:32:27','2015-02-23 21:32:27','',0,'http://localhost:8080/?page_id=8',0,'page','',0),(9,1,'2015-02-23 21:32:27','2015-02-23 21:32:27','','Process','','inherit','open','open','','8-revision-v1','','','2015-02-23 21:32:27','2015-02-23 21:32:27','',8,'http://localhost:8080/?p=9',0,'revision','',0),(10,1,'2015-02-23 21:32:53','2015-02-23 21:32:53','','Data-Models','','publish','open','open','','data-models','','','2015-02-23 21:32:53','2015-02-23 21:32:53','',0,'http://localhost:8080/?page_id=10',0,'page','',0),(11,1,'2015-02-23 21:32:53','2015-02-23 21:32:53','','Data-Models','','inherit','open','open','','10-revision-v1','','','2015-02-23 21:32:53','2015-02-23 21:32:53','',10,'http://localhost:8080/?p=11',0,'revision','',0),(12,1,'2015-02-23 21:33:27','2015-02-23 21:33:27','H2O-Optimizer works directly with service providers to train and implement our technology and services for use in their own businesses. Consultants, agricultural firms, equipment providers, land management agencies, and those involved in crop production can benefit from our decades of experience and success. We provide clients with GIS Analyst and Technical Agronomist services to deliver in-depth training and guidance on the precise practices of our data collection, mapping techniques, irrigation system designs, and Variability Management programs.\r\n By working directly with H2O-Optimizer, clients can focus on their business without having to devote time and resources to developing the techniques and staff needed to achieve successful results. For companies looking to enter the Variability Management Service industry, we also provide training on the data collection components of the fieldwork involved in Phases 1 and 2.  \r\n Of all the people I know in this field, Brian is the most knowledgeable about this technology. And he gives us good information in a succinct way. He doesn’t waste our time. \r\n–A Local Grower','Consulting','','publish','open','open','','consulting','','','2015-02-24 17:11:25','2015-02-24 17:11:25','',0,'http://localhost:8080/?page_id=12',0,'page','',0),(13,1,'2015-02-23 21:33:27','2015-02-23 21:33:27','','Consulting','','inherit','open','open','','12-revision-v1','','','2015-02-23 21:33:27','2015-02-23 21:33:27','',12,'http://localhost:8080/?p=13',0,'revision','',0),(14,1,'2015-02-23 21:34:11','2015-02-23 21:34:11','     Founded in 2010, H2O Optimizer provides custom data driven solutions to reduce costs for farmers through efficient resource management. We believe if you can measure it, you can manage it.\r\n     Created by a certified crop advisor focused on resource management and decision analyses, H2O Optimizer provides the experience and tools to maximize sensor technologies in agriculture production.\r\n     The need for smart irrigation management tools continues to increase as environmental pressures impact resource management. Farmers need to enhance management of their water, soil, and crops.\r\n     FarmitRx is our map based web application. It receives equipment, soil, and plant based telemetry sensor data through manual uploads and automated APIs. While, you can’t change the soil, there is a lot you can do to improve it. By combining the information gathered in the variability management process and solid data models, FarmitRx performs automated analytics and creates actionable recommendations, reports, alerts, calendaring, and tasking — making the most of your soil, resources, and plants.','About Us','','publish','open','closed','','about','','','2015-02-27 00:19:32','2015-02-27 00:19:32','',0,'http://localhost:8080/?page_id=14',0,'page','',0),(15,1,'2015-02-23 21:34:11','2015-02-23 21:34:11','','About Us','','inherit','open','open','','14-revision-v1','','','2015-02-23 21:34:11','2015-02-23 21:34:11','',14,'http://localhost:8080/?p=15',0,'revision','',0),(16,1,'2015-02-23 21:34:51','2015-02-23 21:34:51','','About','','inherit','open','open','','14-revision-v1','','','2015-02-23 21:34:51','2015-02-23 21:34:51','',14,'http://localhost:8080/?p=16',0,'revision','',0),(17,1,'2015-02-23 21:35:08','2015-02-23 21:35:08','We invite you to contact us. Let us show you how we can improve your growing capacity.\r\n    \r\nBrian Bassett\r\n2911 E Barstow Suite 108 \r\nFresno, CA 93740\r\n\r\n559-478-8162\r\n559-714-4048 Fax','Contact','','publish','open','open','','contact','','','2015-02-25 00:12:11','2015-02-25 00:12:11','',0,'http://localhost:8080/?page_id=17',0,'page','',0),(18,1,'2015-02-23 21:35:08','2015-02-23 21:35:08','','Contact','','inherit','open','open','','17-revision-v1','','','2015-02-23 21:35:08','2015-02-23 21:35:08','',17,'http://localhost:8080/?p=18',0,'revision','',0),(19,1,'2015-02-23 21:37:22','2015-02-23 21:37:22','<strong>Conductivity correlates to sand silt and clay in the presence of water and salts</strong>\r\n\r\nIndustry standard for processing EC data is Inverse Distance Weighted Interpolation.  The analysis looks for differences in data points and returns a value based on the difference.  It primarily identifies large differences in data sets and \"smoothes\" the remaining data points removing the points and replacing with an average.  This method allows for use of poor quality data sets. \r\nThe H2O Optimizer data models look for similarities and keep the original data point as relevant with no data smoothing or averaging.  This method identifies poor data set and ensures data integrity.','Soil Mapping','','publish','closed','closed','','soil-mapping','','','2015-02-24 17:20:21','2015-02-24 17:20:21','',0,'http://localhost:8080/?post_type=data_models&#038;p=19',0,'data_models','',0),(20,1,'2015-02-23 21:37:50','2015-02-23 21:37:50','<strong>Images are snapshot in time reflecting current conditions</strong>\r\n\r\nIndustry standard combines multiple temporal and static variables removing data outside of a standardized range.  This method allows for larger data sets to be processed. \r\nH2O Optimizer data model separates images into smaller pieces minimizing effects of temporal and static variables to provide a true representation of the current conditions, no data is removed, requires more time and processing horsepower.','Multi Spectral Imaging','','publish','closed','closed','','multi-spectral-imaging','','','2015-02-24 17:18:39','2015-02-24 17:18:39','',0,'http://localhost:8080/?post_type=data_models&#038;p=20',0,'data_models','',0),(21,1,'2015-02-23 21:38:08','2015-02-23 21:38:08','<strong>Nutrients are measured in parts per million.</strong>\r\n\r\nSand, Silts and Clays covering 1 acre 12 inches deep have a specific weight and density.  Therefore to increase a sand 1 part per million is significantly different than silts, clays and there millions of combination they combine to create.\r\nIndustry standard is to measure current levels and apply generic maximum rates of material irrespective of physical soil characteristics.  This method is Lazy…\r\nH2O Optimizer requires soils physical characteristics such as Organic Matter,  Particle Size (Soil Texture), Bulk Density, Porosity and depth of soil intended to amend and or fertilize accounting for both forms of nutrients available to plant in millequivelants (soil solution) and parts per million (soil extractable) to produce a recommendation.  This method targets specific nutrition levels  of soil profile characteristics.','Soil Fertility','','publish','closed','closed','','soil-fertility','','','2015-02-24 17:17:35','2015-02-24 17:17:35','',0,'http://localhost:8080/?post_type=data_models&#038;p=21',0,'data_models','',0),(22,1,'2015-02-23 21:38:43','2015-02-23 21:38:43','<strong>Water Treatment</strong>\r\n\r\nIndustry standard utilizes calcium, sodium, pH, bicarbonate, and chlorides to determine a calcium or acid recommendation.   This method is focused on sodium and pH\r\nH2O Optimizer data models utilize above variables combined with electrical conductivity, sodium absorption ratio, exchangeable sodium percentage, magnesium and potassium.  This method addresses sodium and pH, imbalances in cations and identifies specific treatment levels to create a target EC - SAR relationship to improve water infiltration.','Ag Water Suitability','','publish','closed','closed','','ag-water-suitability-water-treatment','','','2015-02-24 17:16:43','2015-02-24 17:16:43','',0,'http://localhost:8080/?post_type=data_models&#038;p=22',0,'data_models','',0),(23,1,'2015-02-23 21:39:21','2015-02-23 21:39:21','<strong>Plant Available Water, Bulk Density, Porosity, Organic Matter, Rate of Infiltration and Soil Horizons.</strong>\r\n\r\nThere are no industry standards. Many agriculture labs don’t offer particle size analysis (P.S.A), bulk density, porosity and or rate of infiltration.\r\nH2O Optimizer data model weights each variable by soil horizon or layers to characterize the movement of water, fertilizers and amendments.  All contracted labs provide complete analysis including listed above.','Soil Characteristics','','publish','closed','closed','','soil-characteristics','','','2015-02-24 17:15:17','2015-02-24 17:15:17','',0,'http://localhost:8080/?post_type=data_models&#038;p=23',0,'data_models','',0),(24,1,'2015-02-23 21:39:47','2015-02-23 21:39:47','<strong>Evapotranspiration is a method that estimates the amount of water required by a plant.</strong>\r\n\r\nIndustry standard is based on randomly placed soil moisture sensors or evapotranspiration used as a guide for a total amount of water to apply.\r\nH2O Optimizer data model benefits from the sensor location having been characterized using soil mapping, multi spectral imagery, soil fertility, soil characteristics and plant phenology.  Evapotranspiration is used as a forecasting tool. The data model provides specific daily frequencies and durations based on specific soil profiles.','Irrigation Scheduling','','publish','closed','closed','','irrigation-scheduling','','','2015-02-24 17:14:18','2015-02-24 17:14:18','',0,'http://localhost:8080/?post_type=data_models&#038;p=24',0,'data_models','',0),(25,1,'2015-02-23 21:41:46','2015-02-23 21:41:46','<h4>Map</h4>\r\n\r\nIdentify variability by creating geo databases from multiple data sets—both geophysical and hyper spectral.  ','01','','publish','closed','closed','','map','','','2015-02-24 17:53:27','2015-02-24 17:53:27','',0,'http://localhost:8080/?post_type=processes&#038;p=25',0,'processes','',0),(26,1,'2015-02-23 21:42:49','2015-02-23 21:42:49','<h4>Sample</h4>\r\n\r\nClassify the identified variability of soil, hydration, and crop. ','02','','publish','closed','closed','','sample','','','2015-02-24 17:53:44','2015-02-24 17:53:44','',0,'http://localhost:8080/?post_type=processes&#038;p=26',0,'processes','',0),(27,1,'2015-02-23 21:47:00','2015-02-23 21:47:00','<h4>Design</h4>\r\n\r\nDetermine targeted sensor placement and create detailed variable nutrient and irrigation plans.','03','','publish','closed','closed','','design','','','2015-02-25 22:03:39','2015-02-25 22:03:39','',0,'http://localhost:8080/?post_type=processes&#038;p=27',0,'processes','',0),(28,1,'2015-02-23 21:47:21','2015-02-23 21:47:21','<h4>Inform</h4>\r\n\r\nUse FarmitRx to more efficiently manage water and nutrient resources for higher yields.','04','','publish','closed','closed','','inform','','','2015-02-25 22:03:49','2015-02-25 22:03:49','',0,'http://localhost:8080/?post_type=processes&#038;p=28',0,'processes','',0),(29,1,'2015-02-24 17:10:37','2015-02-24 17:10:37','Founded in 2010, H2O-Optimizer was  created  by Bryan Bassett a Certified Crop Advisor focused on resource management, decision analyses, and to provide the experience and management tools to implement sensor technologies in production agriculture. The need for smart irrigation management tools is increasing. As environmental pressures impact resource management, farmers will need to enhance their management of water, soil, and crops.\r\nThat\'s where we come in. H2O-Optimizer provides custom data driven solutions to reduce costs for farmers through efficient resource management. We simplify and consolidate the everyday data needed for modern and efficient farm management. This helps promote environmentally conscious farming. Through our application FarmitRx, we can streamline data through technology .  \r\nFarmitRx is a map based web and GPS application. It  receives equipment, soil, and plant based telemetry sensor data through manual uploads and automated APIs. Combined with information gathered in the variability management process and solid data models, FarmitRx performs automated analytics and creates actionable recommendations, reports, alerts, calendaring, and tasking. ','About','','inherit','open','open','','14-revision-v1','','','2015-02-24 17:10:37','2015-02-24 17:10:37','',14,'http://localhost:8080/?p=29',0,'revision','',0),(30,1,'2015-02-24 17:11:18','2015-02-24 17:11:18','H2O-Optimizer works directly with service providers to train and implement our technology and services for use in their own businesses. Consultants, agricultural firms, equipment providers, land management agencies, and those involved in crop production can benefit from our decades of experience and success. We provide clients with GIS Analyst and Technical Agronomist services to deliver in-depth training and guidance on the precise practices of our data collection, mapping techniques, irrigation system designs, and Variability Management programs.\r\n By working directly with H2O-Optimizer, clients can focus on their business without having to devote time and resources to developing the techniques and staff needed to achieve successful results. For companies looking to enter the Variability Management Service industry, we also provide training on the data collection components of the fieldwork involved in Phases 1 and 2.  \r\n Of all the people I know in this field, Brian is the most knowledgeable about this technology. And he gives us good information in a succinct way. He doesn’t waste our time. \r\n–A Local Grower','Consulting','','inherit','open','open','','12-revision-v1','','','2015-02-24 17:11:18','2015-02-24 17:11:18','',12,'http://localhost:8080/?p=30',0,'revision','',0),(31,1,'2015-02-24 17:13:03','2015-02-24 17:13:03','We invite you to contact us. Let us show you how we can improve your growing capacity.    \r\nBrian Bassett\r\n2911 E Barstow Suite 108 \r\nFresno, CA 93740\r\n559-478-8162\r\n559-714-4048 Fax','Contact','','inherit','open','open','','17-revision-v1','','','2015-02-24 17:13:03','2015-02-24 17:13:03','',17,'http://localhost:8080/?p=31',0,'revision','',0),(32,1,'2015-02-24 17:52:15','2015-02-24 17:52:15','<h4>Inform</h4>\n\nUse FarmitRx to more efficiently manage water and nutrient resources for higher yields.','04','','inherit','open','open','','28-autosave-v1','','','2015-02-24 17:52:15','2015-02-24 17:52:15','',28,'http://localhost:8080/?p=32',0,'revision','',0),(33,1,'2015-02-24 17:57:42','2015-02-24 17:57:42','Founded in 2010, H2O Optimizer provides custom data driven solutions to reduce costs for farmers through efficient resource management. We believe if you can measure it, you can manage it. \r\nCreated by a certified crop advisor focused on resource management and decision analyses, H2O Optimizer provides the experience and tools to maximize sensor technologies in agriculture production. \r\nThe need for smart irrigation management tools continues to increase as environmental pressures impact resource management. Farmers need to enhance management of their water, soil, and crops.\r\nFarmitRx is our map based web application. It receives equipment, soil, and plant based telemetry sensor data through manual uploads and automated APIs. While, you can’t change the soil, there is a lot you can do to improve it. By combining the information gathered in the variability management process and solid data models, FarmitRx performs automated analytics and creates actionable recommendations, reports, alerts, calendaring, and tasking — making the most of your soil, resources, and plants.\r\n','About','','inherit','open','open','','14-revision-v1','','','2015-02-24 17:57:42','2015-02-24 17:57:42','',14,'http://localhost:8080/?p=33',0,'revision','',0),(34,1,'2015-02-25 00:12:11','2015-02-25 00:12:11','We invite you to contact us. Let us show you how we can improve your growing capacity.\r\n    \r\nBrian Bassett\r\n2911 E Barstow Suite 108 \r\nFresno, CA 9